import React from "react";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";
import Img from "../ asset/fofl.png";

const Logo = styled("img")(({ theme }) => ({
  position: "relative",
  width: "100px",

  [theme.breakpoints.down("sm")]: {
    width: "100px",
    position: "relative",
  },
}));

const Head = styled("div")((theme) => ({
  fontFamily: "Roboto",
  fontSize: "52px",
  fontWeight: 400,
  lineHeight: "68px",
  letterSpacing: "0em",
  position: "relative",
  top: "40px",
  [theme.breakpoints.down("sm")]: {},
}));

function Home() {
  return (
    <>
      <div className="sec1">
        <Box
          sx={{
            height: "179px",
            maxWidth: "100%",
          }}
        >
          <Container>
            <Grid
              container
              sx={{
                position: "relative",
                top: "50px",
              }}
            >
              <Grid item xs={5} sm={6}>
                <Logo src={Img}></Logo>
              </Grid>
              <Grid item xs={4} sm={4}></Grid>
              <Grid item xs={3} sm={2}>
                condut us
              </Grid>
            </Grid>
          </Container>
        </Box>

        <Head> MANAGEMENT & SERVICES COMPANY</Head>
      </div>
    </>
  );
}

export default Home;
